    National Agricultural Library in 2007. The thesaurus has in depth coverage of agriculture,
    biology and related disciplines. It contains over 73,000 terms, including 26,000
    cross references and is arranged into 17 subject categories. It is annually updated
    each January. This thesaurus is a cooperative product of the National Agriculture
    Library and the Inter-American Institute for Cooperation on Agriculture (IICA).
